INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (1, 24001, 102601, 0.0, "2030/12/17 14:59:59", 24, 1, "リン", "あたしだって\nやるときはやるよ！", 0.0, "2020/04/30 12:00:00", 0, 0.0, 10040);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (1, 24002, 102601, 0.0, "2030/12/17 14:59:59", 24, 1, "リン", "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, "2020/04/30 12:00:00", 1, 0.0, 10040);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (1, 24003, 102601, 0.0, "2030/12/17 14:59:59", 24, 1, "リン", "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, "2020/04/30 12:00:00", 2, 0.0, 10040);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (2, 24004, 102601, 0.0, "2030/12/17 14:59:59", 24, 2, "リン", "やったね！\nこれでようやく\nサボれるよ…", 0.0, "2020/04/30 12:00:00", 3, 0.0, 10040);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (1, 24005, 102601, 0.0, "2030/12/17 14:59:59", 24, 1, "リン", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, "2020/04/30 12:00:00", 4, 0.0, 10040);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (2, 24006, 102601, 0.0, "2030/12/17 14:59:59", 24, 2, "リン", "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, "2020/04/30 12:00:00", 5, 0.0, 10040);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (2, 24007, 102601, 0.0, "2030/12/17 14:59:59", 24, 2, "リン", "あたしも意外と\nやるもんでしょ？", 0.0, "2020/04/30 12:00:00", 6, 0.0, 10040);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (4, 24008, 102601, 0.0, "2030/12/17 14:59:59", 24, 4, "リン", "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, "2020/04/30 12:00:00", 7, 0.0, 10040);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (4, 24009, 102601, 0.0, "2030/12/17 14:59:59", 24, 4, "リン", "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, "2020/04/30 12:00:00", 8, 0.0, 10040);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (4, 24010, 102601, 0.0, "2030/12/17 14:59:59", 24, 4, "リン", "まじめに\nやったんだけどな…\n悔しいな～", 0.0, "2020/04/30 12:00:00", 9, 0.0, 10040);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (4, 24011, 102601, 0.0, "2030/12/17 14:59:59", 24, 4, "リン", "やられた…\nねずみって意外と\nてごわいね", 0.0, "2020/04/30 12:00:00", 10, 0.0, 10040);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (4, 24012, 102601, 0.0, "2030/12/17 14:59:59", 24, 4, "リン", "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, "2020/04/30 12:00:00", 11, 0.0, 10040);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (4, 24013, 102601, 0.0, "2030/12/17 14:59:59", 24, 1, "リン", "疲れた…\nけど、次こそは\n守り抜くよ…", 0.0, "2020/04/30 12:00:00", 12, 1.81, 10040);
